import React from 'react';
import web from '../src/images/img2.jpeg';
import Card from './Card';
import Sdata from './Sdata';


const Service=()=>{
    return(
        <>
           
            <div className="my-5">
            <h1 id="hh" className="text-center">Sincere Group</h1>
            </div>
            
    <div class="row">
        <div class="col-sm-12 col-lg-6">
            <div class="card h-100">
                  {Sdata.map((val,ind)=>{
                        return <Card key={ind}
                            imgsrc={val.imgsrc}
                            title={val.title}
                            text={val.text}
                        />
                    })}
            </div>
            </div>
            </div>
           
           
        </>
    );
};


export default Service;
